import React from "react";

<Splide
  options={{
    // gap: "0rem",
    speed: "3000",
    autoplay: true,
    type: "loop",
    pauseOnHover: true,
    wheel: true,
    // interval: 10,
    drag: true,
  }}
>
  <SplideSlide
    data-aos="fade-right"
    data-aos-easing="ease-in-out"
    data-aos-delay="50"
    data-aos-duration="1000"
  >
    <div></div>
  </SplideSlide>

  <SplideSlide>
    <div></div>
  </SplideSlide>
  <SplideSlide>
    <div></div>
  </SplideSlide>
</Splide>;

const Bounties = () => {
  return <div></div>;
};

export default Bounties;
